06e\u0075\u0020\u0066\u006f\u006f\u0074\u0065\u0072\u0022\u003e\u0110\u1ecb\u0061\u0020\u0063\u0068\u1ec9\u003a\u0020\u0031\u0020\u0050\u002e\u0020\u0058\u00f4\u0301\u006d\u002c\u0020\u0050\u0068\u00fa\u0020\u004c\u00e2\u006d\u002c\u0020\u0048\u00e0\u0020\u0110\u00f4\u006e\u0067\u002c\u0020\u0048\u004e\u003c\u002f\u006c\u0069\u003e\u000a\u0020\u0020\u0020\u0020\u0020\u0020\u003c\u006c\u0069\u0020\u0063\u006c\u0061\u0073\u0073\u003d\u0022\u006d\u0065\u006e\u0075\u0020\u0066\u006f\u006f\u0074\u0065\u0072\u0022\u003e\u000a\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0110\u0069\u1ec7\u006e\u0020\u0074\u0068\u006f\u1ea1\u0069\u003a\u0020\u0030\u0032\u0034\u0033\u0035\u0035\u0037\u0037\u0037\u0039\u0039\u003c\u002f\u006c\u0069\u003e\u000a\u0020\u0020\u0020\u0020\u0020\u0020\u003c\u006c\u0069\u0020\u0063\u006c\u0061\u0073\u0073\u003d\u0022\u006d\u0065\u006e\u0075\u0020\u0066\u006f\u006f\u0074\u0065\u0072\u0022\u003e\u0045\u006d\u0061\u0069\u006c\u003a\u0020\u0064\u0061\u0069\u006e\u0061\u006d\u0040\u0065\u0064\u0075\u002e\u0076\u006e\u003c\u002f\u006c\u0069\u003e\u000a\u0020\u0020\u0020\u0020\u003c\u002f\u0064\u0069\u0076\u003e\u000a\u0020\u0020\u0020\u0020\u003c\u0064\u0069\u0076\u0020\u0063\u006c\u0061\u0073\u0073\u003d\u0022\u0065\u006c\u0065\u006d\u0065\u006e\u0074\u002d\u0066\u006f\u006f\u0074\u0065\u0072\u0022\u003e\u000a\u0020\u0020\u0020\u0020\u0020\u0020\u003c\u0068\u0033\u0020\u0063\u006c\u0061\u0073\u0073\u003d\u0022\u0063\u006f\u006e\u0074\u0065\u006e\u0074\u002d\u0066\u006f\u006f\u0074\u0065\u0072\u0022\u003e\u000a\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0026\u006e\u0062\u0073\u0070\u003b\u000a\u0020\u0020\u0020\u0020\u003c\u002f\u0064\u0069\u0076\u003e\u000a\u0020\u0020\u0020\u0020\u000a\u0020\u0020\u0020\u0020\u003c\u0064\u0069\u0076\u0020\u0063\u006c\u0061\u0073\u0073\u003d\u0022\u0065\u006c\u0065\u006d\u0065\u006e\u0074\u002d\u0066\u006f\u006f\u0074\u0065\u0072\u0022\u003e\u000a\u0020\u0020\u0020\u0020\u0020\u0020\u003c\u0068\u0033\u0020\u0063\u006c\u0061\u0073\u0073\u003d\u0022\u0063\u006f\u006e\u0074\u0065\u006e\u0074\u002d\u0066\u006f\u006f\u0074\u0065\u0072\u0020\u006d\u0061\u0075\u0066\u006f\u006e\u0074\u0022\u0020\u0073\u0074\u0079\u006c\u0065\u003d\u0022\u0066\u006f\u006e\u0074\u002d\u0073\u0069\u007a\u0065\u003a\u0020\u0031\u0032\u0030\u0025\u003b\u0022\u003e\u000a\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0043\u0068\u1ee9\u0063\u0020\u004e\u0103\u006e\u0067\u003c\u002f\u0068\u0033\u003e\u000a\u0020\u0020\u0020\u0020\u0020\u0020\u003c\u0075\u006c\u0020\u0063\u006c\u0061\u0073\u0073\u003d\u0022\u0066\u006f\u006f\u0074\u0065\u0072\u0022\u003e\u000a\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u003c\u0061\u0020\u0068\u0072\u0065\u0066\u003d\u0022\u002e\u002e\u002f\u0069\u006e\u0064\u0065\u0078\u002e\u0068\u0074\u006d\u006c\u0022\u003e\u003c\u006c\u0069\u0020\u0063\u006c\u0061\u0073\u0073\u003d\u0022\u006d\u0065\u006e\u0075\u0020\u0066\u006f\u006f\u0074\u0065\u0072\u0022\u003e\u0054\u0072\u0061\u006e\u0067\u0020\u0043\u0068\u1ee7\u003c\u002f\u006c\u0069\u003e\u003c\u002f\u0061\u003e\u000a\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u003c\u0061\u0020\u0068\u0072\u0065\u0066\u003d\u0022\u002e\u002e\u002f\u0073\u0072\u0063\u002f\u006b\u0068\u006f\u0061\u0068\u006f\u0063\u002e\u0068\u0074\u006d\u006c\u0022\u003e\u003c\u006c\u0069\u0020\u0063\u006c\u0061\u0073\u0073\u003d\u0022\u006d\u0065\u006e\u0075\u0020\u0066\u006f\u006f\u0074\u0065\u0072\u0022\u003e\u004b\u0068\u00f3\u0061\u0020\u0048\u1ecd\u0063\u003c\u002f\u006c\u0069\u003e\u003c\u002f\u0061\u003e\u000a\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u003c\u0061\u0020\u0068\u0072\u0065\u0066\u003d\u0022\u002e\u002e\u002f\u0073\u0072\u0063\u002f\u0067\u0069\u0061\u006e\u0067\u0076\u0069\u0065\u006e\u002e\u0068\u0074\u006d\u006c\u0022\u003e\u003c\u006c\u0069\u0020\u0063\u006c\u0061\u0073\u0073\u003d\u0022\u006d\u0065\u006e\u0075\u0020\u0066\u006f\u006f\u0074\u0065\u0072\u0022\u003e\u0047\u0069\u00e1\u006f\u0020\u0056\u0069\u00ea\u006e\
